import React from "react";
import { Card, CardBody, CardText } from "reactstrap";

const TechStack = () => {
  return (
    <Card>
      <CardBody>
        <CardText>
          <b>
            <ul>
              <li>Full-Stack Web Developer</li>
              <li>Ruby on Rails</li>
              <li>React</li>
              <li>PostgreSQL</li>
              <li>Jest</li>
            </ul>
          </b>
        </CardText>
      </CardBody>
    </Card>
  );
};

export default TechStack;
